  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Selawik
  National Wildlife Refuge outlines Refuge accomplishments during the 1982 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  Land acquisition is covered. The report includes a planning section which discusses
  the master plan and the management plan. Refuge administration is outlined; information
  about personnel, funding, safety, and technical assistance is given. Habitat management
  is also covered; subjects include wetlands, forests, croplands, grazing, fire management,
  water rights, and wilderness areas. The wildlife section of the report discusses
  wildlife diversity, endangered and threatened species, waterfowl, marsh birds and
  waterbirds, marine mammals, and fisheries resources. The public uses of the Refuge
  described in this report include hunting, fishing, and trapping. The equipment and
  facilities section of the report provides information about new construction, equipment
  replacement, communication systems, and energy conservation.\",\n\t\"owner_org\":
